service: next-sso-demo
component: '@sls-next/serverless-component@latest'

inputs:
  bucketName: next-sso-assets-${stage}
  region: us-east-1
  memory: 1024
  timeout: 15
  cloudfront:
    defaults:
      ttl: 0
      forward:
        cookies: all
        headers:
          - Authorization
  env:
    STAGE: ${stage}
    NODE_ENV: ${env:NODE_ENV, "dev"}
    JWT_SECRET: ${env:JWT_SECRET}
    PIANO_API: ${env:PIANO_API}
    PIANO_REPORT_API: ${env:PIANO_REPORT_API}
    ALLOWED_DOMAINS: ${env:ALLOWED_DOMAINS}
    ELCOMERCIO_AID: ${env:ELCOMERCIO_AID}
    GESTION_AID: ${env:GESTION_AID}
    CLUBELCOMERCIO_AID: ${env:CLUBELCOMERCIO_AID}
    ELCOMERCIO_API_TOKEN: ${env:ELCOMERCIO_API_TOKEN}
    GESTION_API_TOKEN: ${env:GESTION_API_TOKEN}
    CLUBELCOMERCIO_API_TOKEN: ${env:CLUBELCOMERCIO_API_TOKEN}
    SENTRY_DNS: ${env:SENTRY_DNS}
